import React, { Component } from 'react';
import '../style/App.css';

class App22 extends Component {
    render() {
        var hour = new Date().getHours();

        if (hour >= 8 && hour <= 10) {
            //At GYM
            return (
                <div className="Gym">
                    <p className="test">At gym</p>
                    <p>Right now I am most likely preparing myself for the day by physically engaging my body
                    at the gym.</p>
                </div>
            );
        } else if (hour >= 11 && hour <= 17) {
            //LEARNING
            return (
                <div className="Learning">
                    <p>Learning</p>
                    <p>Right now I am most likely keeping myself occupied by either honing my coding skills
                    or looking for new technologies to learn.</p>
                </div>

            );
        } else if (hour >= 18 && hour <= 21) {
            //HOBBIES
            return (
                <div className="Hobbies">
                    <p>Hobbies/Relaxation</p>
                    <p>Right now I am most likely putting all my business aside to relax after a hard day's work.</p>
                </div>
            );
        } else {
            //SLEEPING
            return (
                <div className="Sleeping">
                    <p>Sleeping</p>
                    <p>Right now I am most likely either sleeping or preparing to sleep.</p>
                </div>
            )
        }
    }
}

export default App22;
